async function editJadwal(name,nik,date,typeDns){$("#editJadwalLabel").text(name);new Date(date).toISOString().slice(0,10);$("#tgl").val(date),$("#select").val(typeDns),$("#nik").val(nik),$("#editJadwal").modal("show")}async function saveJadwal(){let nik=$("#nik").val(),date=$("#tgl").val(),jadwal={nik:nik,typeDns:$("#select").val(),date:date};$.ajax({url:"/api/presensi/anggota",method:"POST",data:jadwal,success:function(data){getTabel($("#periode").val()),Swal.fire(data.message,"data berhasil diubah","success")},error:function(data){Swal.fire(data.responseJSON.message,data.responseJSON.data,"error")}})}
